DROP TABLE IF EXISTS `user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user` (
  `user_id` bigint(20) NOT NULL COMMENT '用户 ID',
  `username` varchar(128) NOT NULL COMMENT '账号',
  `nickname` varchar(256) NOT NULL COMMENT '昵称',
  `password` varchar(128) NOT NULL COMMENT '密码',
  `email` varchar(256) DEFAULT NULL COMMENT '邮件地址',
  `mobile` varchar(64) DEFAULT NULL COMMENT '手机号码',
  `phone` varchar(64) DEFAULT NULL COMMENT '固定电话',
  `avatar` varchar(512) DEFAULT NULL COMMENT '头像 URL',
  `gender` tinyint(4) DEFAULT '0' COMMENT '性别: 0 (未设置)、1 (男)、2 (女)',
  `org_id` bigint(20) NOT NULL COMMENT '机构 ID',
  `enabled` tinyint(4) DEFAULT '1' COMMENT '状态: 0 (禁用), 1 (启用)',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`user_id`) COMMENT '用户的 ID 作为主键',
  UNIQUE KEY `index_org_user` (`org_id`,`username`) COMMENT '同一个机构用户名不能重复'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;
/*!40101 SET character_set_client = @saved_cs_client */;

